    [Route("api/[controller]")]
    [ApiController]
    public class CerController : ControllerBase
    {
        private readonly Certificate _Cer;
        private readonly IConfiguration configuration;
        public CerController(IConfiguration _configuration)
        {
            configuration = _configuration;
            _Cer = new Certificate(configuration);
        }

        [HttpPost("")]
        public async Task<IActionResult> Index([FromQuery] string cipher)
        {
            return Ok("Cer Ok");
        }

        // GET api/<ValuesController>/5
        [HttpPost("CreateSelfCA")]
        public async Task<IActionResult> CreateSelfCA([FromQuery] string issued, [FromQuery] string password, [FromQuery] string fileName, [FromQuery] int expireAfter = 30, [FromQuery] bool isUpdate = false)
        {
            string msg = await _Cer.createSelfCer(issued, password, fileName, expireAfter, isUpdate);
            //bool createdResult = true;
            if (string.IsNullOrEmpty(msg))
            {
                var response = new
                {
                    Data = "Created",
                    Status = true,
                };
                return Ok(response);
            }
            else
            {
                var response = new
                {
                    Data = msg,
                    Status = false,
                };
                return Ok(response);
            }
        }

