        [HttpGet("UploadFile")]
        public async Task<IActionResult> UploadFile([FromQuery] string filePath, [FromQuery] string fileName)
        {
            var docStream = System.IO.File.ReadAllBytes(filePath);
            var result = await _Cer.UploadFile(docStream, fileName);
            return Ok(result);
        }
